window.bookSummaryJSON = "<p>Thirty-three shorter tales of the Liaden Universe® brought together for the first time in two mega-volumes. Seventeen tales to start with in Volume One!</p> <p>The nationally bestselling Liaden Universe® novels are treasured by space opera aficionados for their wit, world-building, strong characterizations, tender romance, and edge-of-the-chair action.</p> <p>Since 1995, Sharon Lee and Steve Miller also created shorter tales, illuminating additional facets of the Liaden experience. Here is a vast tapestry of tales of the scouts, artists, traders, priestesses, sleight of hand magicians, and pilots who fill the Liaden Universe® with the excitement, action, and romance that listeners of the hit series have come to adore.</p>"; 
